import React from  'react'
import {Routes, Route, Navigate} from 'react-router-dom'

import Home from '../frontend/src/pages/Home';
import Tours from '../frontend/src/pages/Tours';
import TourDetails from '../frontend/src/pages/TourDetails';
import Login from '../frontend/src/pages/Login';
import Register from '../frontend/src/pages/Register';
import SearchResultList from '../frontend/src/pages/SearchResultList';
import ThankYou from '../frontend/src/pages/ThankYou';

const Routers = () => {
    return (
        <Routes>
            <Route path='/' element={<Navigate to='/home'/>} />
            <Route path='/home' element={<Home/>}/>
            <Route path='/tours' element={<Tours/>}/>
            <Route path='/tours/:id' element={<TourDetails/>}/>
            <Route path='/login' element={<Login/>}/>
            <Route path='/register' element={<Register/>}/>
            <Route path='/thank-you' element={<ThankYou/>}/>
            <Route path='/tours/search' element={<SearchResultList/>}/>
        </Routes>
    )
}

export default Routers
